import React, { useState } from "react";
import styled from "styled-components";
import Sidebar from "../Components/Sidebar";

//명함 만들기 main 화면
const MakemainPositioner = styled.div`
  display: flex;
`;
// 출력폼
const Makemain1 = styled.div`
  border-style: solid;
  width: 50%;
  height: 100vh;
  margin-top: 1rem;
`;

// 입력폼
const Makemain2 = styled.div`
  border-style: solid;
  width: 50%;
  height: 100vh;
  margin-top: 1rem;
`;
// 명함 컬러 선택하기
const Cololselector = styled.div`
  display: flex;
  justify-content: center;
  font-size: 20px;
  flex-wrap: wrap;
`;

const Colorbuttons = styled.div`
  display: flex;
  justify-content: center;
  width: 100%;
`;

function Myspace() {
  const [color, setColor] = useState("");
  return (
    <MakemainPositioner>
      <Sidebar />
      <Makemain1> 안녕 </Makemain1>
      <Makemain2>
        <Cololselector>
          명함 컬러 선택하기
          <Colorbuttons>
            <button>빨강</button>
            <button>주황</button>
            <button>노랑</button>
            <button>파랑</button>
            <div>{color}</div>
          </Colorbuttons>
        </Cololselector>
      </Makemain2>
    </MakemainPositioner>
  );
}

export default Myspace;
